import React from "react";
import emojipedia from "../emojipedia";
import Ret from "./Emoji";

function emojiRender(emojipedia){
  return <div>
    <h1>
        <span>emojipedia</span>
      </h1>
      <Ret emoji={emojipedia.emoji} title={emojipedia.name} body={emojipedia.meaning} />
  </div>
}

function App() {
  return emojipedia.map(emojiRender)
}

export default App;
